package com.sdp.self_rpc_done.publicInterface;public class MessageOutput {    private String requestId;    private String type;    private Object payload;    public MessageOutput(String requestId, String type, Object payload) {        this.requestId = requestId;        this.type = type;        this.payload = payload;    }    public String getType() {        return this.type;    }    public String getRequestId() {        return requestId;    }    public Object getPayload() {        return payload;    }    public void setRequestId(String requestId) {        this.requestId = requestId;    }    public void setType(String type) {        this.type = type;    }    public void setPayload(Object payload) {        this.payload = payload;    }    @Override    public String toString() {        return "MessageOutput{" +                "requestId='" + requestId + '\'' +                ", type='" + type + '\'' +                ", payload=" + payload +                '}';    }}